import React from 'react';
import ListingForm from '../ListingForm'; // Adjust the path as necessary

const AssetSell = () => {
  return (
    <main>
      <section className="container">
        <h1>Sell Your Asset</h1>
        <ListingForm />
      </section>
    </main>
  );
}

export default AssetSell;
